import { Container } from "./style";
import { ResultCard } from "../../components/ResultCard";
import { useResults } from "../../providers/Results"


export const Results = () => {



    const { results, resultsSearch } = useResults()

    console.log(results)

    return (
        <>
            <h1>RESULTS</h1>
            <ResultCard user={results[5]}></ResultCard>
            <button onClick={() => { resultsSearch("luiz") }}>vv</button>

        </>
    )
}
